import base64
import json

# Full base64 string from terminal output
data = ""

try:
    # Clean up any whitespace/newlines that might have been introduced
    clean_data = "".join(data.split())
    decoded = base64.b64decode(clean_data).decode('utf-8')
    print("Decoded content:")
    print(decoded)
    # also try to pretty print if it's json
    try:
        jd = json.loads(decoded)
        print("\nJSON Structure:")
        print(json.dumps(jd, indent=2))
    except:
        print("\nNot a valid JSON structure at top level")
except Exception as e:
    print(f"Error decoding: {e}")
